import React from 'react'
import { Jumbotron, Container } from 'reactstrap';

const h3 = {
	color:"white"

}

const container = {
	 backgroundImage: url("img/jumbotron_background.jpg"),
}

const Jumbo = (props) => {
	return (
		<div>
		<Jumbotron fluid>
			<Container>
				<h3 style={h3}>점보트론</h3>
			</Container>
		</Jumbotron>
		</div>
	);
};

export default Jumbo;
